column8:
サーカスをモチーフにデザインされた「シルクドカプリス」シリーズの付箋です。<br>
テント型の台紙に、4種類の動物型の付箋が付いています。<br>
手描きのやさしいタッチがキュート♪<br>
本やノートに挟めばひょっこり出てくる動物たちに思わず笑顔がこぼれます。<br>
<br>
<br>
<b>【　仕　様　】</b><br>
カラー：レッド、ブルー<br>
素材：紙<br>
付箋：約横13×縦60mm ×4種
台紙：横105×縦100mm<br>
<br>

<B>【DM便について】</B><br>1.DM便で配送可能な商品は、品名に【DM便OK】と入ります。<br>2.配達日、配達時間の指定はお受けできません。<br>3.お支払い方法につきましては、クレジットカード決済・銀行振り込み・楽天バンク決済とさせて頂きます。<br>4.サイズや重量の規定がございますので、複数注文された場合などDM便不可になる場合がございます。<br><br>上記4つの条件を満たしていない場合にDM便を選択された場合は、<br>誠に勝手ながら宅配便での発送とさせて頂きます。<br>送料も宅配便の料金となります。 <br><br>

<br>
メーカー希望小売価格はメーカーサイトに基づいて掲載しています
